import React from 'react';
import { useNavigate, Link } from 'react-router-dom';
import '../css/Log_SignPage.css';
import logoImage from '../logo.png';

function Log_SignPage() {
  const navigate = useNavigate();

  const handleGoogleLogin = async () => {
    // 가정: 구글 로그인 로직 (API 연결 등이 필요합니다)
    try {
      // 여기에 구글 로그인 로직 추가
      // 구글 로그인 성공 시 navigate('/add')로 이동
      // 성공 시 이동하는 코드 (현재는 테스트로 바로 이동)
      navigate('/add');
    } catch (error) {
      console.error('Google login failed:', error);
      alert('Google 로그인에 실패했습니다.');
    }
  };

  return (
    <div className="logSignPage">
      <Link to="/" className="logSign-logo">
        <img src={logoImage} alt="Logo" />
      </Link>
      <div className="logSignBox">
        <h2>로그인 및 회원가입</h2>
        <p>소셜 로그인 및 회원가입으로<br />MOVIELY의 모든 서비스를 이용하실 수 있습니다.</p>
        <button className="googleLoginButton" onClick={handleGoogleLogin}>
          Google로 시작하기
        </button>
      </div>
    </div>
  );
}

export default Log_SignPage;
